  "msg_pol_tica_de_cancelamento":
      "Política de cancelamento de reserva de estacionamento no parque\n\nNo Park Space, entendemos que às vezes os planos mudam. Nossa política de cancelamento foi projetada para ser justa tanto com nossos usuários quanto com nossos anfitriões de estacionamento. Abaixo está nossa política de cancelamento detalhada:\n\nReservas Flexíveis:\nAs reservas flexíveis permitem o cancelamento gratuito até pelo menos 24 horas antes da hora de início da reserva. Se você cancelar com menos de 24 horas de antecedência, os anfitriões poderão cobrar 50% do valor da reserva.\n\nReservas Padrão:\nOs usuários receberão um reembolso total se cancelarem dentro de 48 horas após a reserva e pelo menos 14 dias antes da data de chegada. Se cancelado entre 7 e 14 dias antes da data de chegada, os anfitriões poderão cobrar 50% do valor da reserva. Se você cancelar com menos de 7 dias de antecedência, os anfitriões poderão cobrar 100% do valor da reserva.\n\nReservas não reembolsáveis:\nAlgumas reservas podem não ser reembolsáveis ​​e serão claramente indicadas no momento da reserva. Isso significa que nenhum reembolso será feito em caso de cancelamento.\n\nComo cancelar uma reserva:\nVocê pode cancelar uma reserva diretamente no aplicativo Park Space. Acesse seu histórico de reservas, selecione a reserva que deseja cancelar e siga as instruções.\n\nReembolso de cancelamento:\nOs reembolsos serão processados ​​em até 7 dias úteis após o cancelamento e serão creditados na forma de pagamento utilizada na reserva original.\n\nOs usuários também podem solicitar reembolso por motivo de força maior. Isto inclui eventos imprevistos, como uma doença grave, um desastre natural ou uma morte na família. O Park Space avaliará cada inscrição individualmente para determinar se ela atende aos requisitos.\n\nMudanças nas Reservas:\nCaso queira fazer alterações em uma reserva existente, como data, horário ou duração, entre em contato com o anfitrião e faça a solicitação de alteração da data. A alteração é feita automaticamente antes de 14 dias da data de chegada, sendo que com menos de 14 dias é necessária uma autorização do anfitrião para a alteração.\n\nContato de atendimento ao cliente:\nPara cancelar ou modificar uma reserva, ou se tiver alguma dúvida sobre nossa política de cancelamento, não hesite em entrar em contato com nossa equipe de atendimento ao cliente via chat ou e-mail.\n\nEsta política de cancelamento está sujeita a alterações e atualizações periódicas. Recomendamos que você o revise antes de fazer qualquer reserva no Park Space para garantir que está ciente das condições atuais.\nObrigado por escolher o Park Space para suas necessidades de estacionamento. Estamos aqui para tornar a sua experiência o mais conveniente possível.\nAtentamente,\n\nEspaço no parque\nEmail de contato\n",
