  // Terms and conditions Screen
  "msg_estes_termos_e_condi_es":
      "Estes Termos e Condições (\"Termos\") regem o uso da plataforma e dos serviços oferecidos pela Park Space (\"a Empresa\") por meio de seu site e aplicativo móvel. Ao acessar e usar os serviços do Park Space, você concorda em cumprir e ficar vinculado a estes Termos e à nossa Política de Privacidade. Por favor, leia estes Termos cuidadosamente antes de usar nossos serviços.\n\n1.    Descrição dos Serviços O Park Space fornece uma plataforma on-line que permite aos proprietários de garagens (\"Anfitriões\") oferecer suas vagas de estacionamento para aluguel por temporada e aos usuários (\"Hóspedes\") pesquisar e reservar essas vagas de estacionamento. A Empresa atua apenas como intermediária neste processo e não é proprietária nem administra as garagens.\n\n2.    Responsabilidade do usuário\n2.1. Ao se cadastrar no Park Space, você declara ser maior de idade e ter capacidade legal para celebrar contratos.\n2.2. Você concorda em fornecer informações precisas e atualizadas durante o processo de registro e em manter a confidencialidade de suas credenciais de login.\n23. Você é responsável por todas as atividades realizadas em sua conta e concorda em notificar a Empresa imediatamente no caso de qualquer uso não autorizado.\n\n3.    Relacionamento entre Anfitriões e Convidados\n3.1. A Empresa não é responsável pelas interações entre Anfitriões e Hóspedes. Qualquer contrato de aluguer é estabelecido diretamente entre as partes envolvidas.\n3.2. Os anfitriões são responsáveis ​​pela exatidão e veracidade das informações fornecidas nos seus anúncios, bem como pela disponibilidade e estado dos seus lugares de estacionamento.\n3.3. Os hóspedes deverão respeitar as regras e condições estabelecidas pelos Anfitriões durante a sua estadia nos lugares de estacionamento alugados.\n\n4.    Taxas e Pagamentos\n4.1. Os anfitriões definem o preço do aluguel de suas vagas de estacionamento. A Empresa reserva-se o direito de aplicar uma comissão por cada reserva efetuada através da plataforma.\n\n4.2. Os pagamentos são efetuados através da plataforma e a Empresa é responsável pela gestão das correspondentes cobranças e pagamentos entre Anfitriões e Hóspedes.\n\n4.3. Os hóspedes devem fornecer informações de pagamento válidas e autorizar a Empresa a cobrar o valor total da reserva, incluindo taxas e comissões aplicáveis.\n\n5.    Cancelamentos e Reembolsos\n5.1. As políticas de cancelamento e reembolso são estabelecidas por cada Anfitrião e estão indicadas nos seus anúncios.\n5.2. A Empresa reserva-se o direito de aplicar uma política de cancelamento padrão se o Anfitrião não a tiver especificado.\n5.3. Em caso de cancelamento, os reembolsos estarão sujeitos às políticas de cancelamento estabelecidas pelo Anfitrião e às condições especificadas na reserva.\n\n6.    Propriedade Intelectual\n6.1. Todos os conteúdos e materiais apresentados na plataforma Park Space, incluindo logotipos, designs, textos e gráficos, são protegidos por direitos autorais e propriedade intelectual.\n6.2. Nenhuma reprodução, distribuição, modificação ou uso não autorizado de qualquer conteúdo é permitida sem o consentimento prévio por escrito da Empresa.\n\n7.    Limitação de Responsabilidade\n7.1. A Empresa não se responsabiliza por quaisquer danos, perdas ou ferimentos relacionados ao uso dos serviços do Park Space.\n7.2. Anfitriões e Hóspedes utilizam os serviços do Espaço do Parque por sua própria conta e risco e concordam que a Empresa não será responsável por quaisquer disputas, danos ou perdas decorrentes das transações ou interações entre eles.\n\n8.    Legislação Aplicável e Jurisdição Estes Termos são regidos pelas leis espanholas e europeias. Qualquer litígio que surja em relação a estes Termos estará sujeito à jurisdição exclusiva dos tribunais competentes de Espanha.\n\nEstes Termos e Condições constituem o acordo integral entre você e o Park Space em relação ao uso de nossos serviços. Ao utilizar nossos serviços, você concorda em cumprir estes Termos. Se você não concorda com algum destes termos, por favor não utilize nossos serviços.",
